import {BrowserRouter as Router, Route} from "react-router-dom";
import Cont from './Cont';
import Headers from './Header';

function App() {
  return (
    <>
    <Header/>
    <Router>
        <Route path='/' element={<Cont/>}>

        </Route>
      </Router>
    </>

  );
}

export default App;
